// About.js
import React from 'react';
function artsphere() {
    return (
        <div className="about-container">
            <h1>About Art Sphere</h1>
            <div className="images-container">
                <img src="art1.jpg" alt="Image 1" className="image" />
                <img src="art2.jpg" alt="Image 2" className="image" />
                <img src="art3.jpg" alt="Image 3" className="image" />
                <img src="art4.jpg" alt="Image 4" className="image" />
                <img src="art5.jpg" alt="Image 5" className="image" />
                <img src="art6.jpg" alt="Image 6" className="image" />
            </div>
        </div>
    );
}

export default artsphere;
